import "./footer.css"
import { useNavigate } from "react-router-dom"

const ir = useNavigate();

const irHome = ()=> {
    ir ('/');
}

const Footer = () => {
    return <footer className="footer-elements">
        <img className="logo" src="/img/logo.png" alt="logo"></img>
    </footer>
}

export default Footer
